import { Routes, Route } from "react-router-dom";
import React from "react";
import "./App.css";
import { FormPage } from "./pages/FormPage";

function App() {
  return (
    <div className="App">
      <Routes>
          <Route path="/movies" element={<MoviesPage />} />
          <Route path="/movies/:id" element={<MoviePage />} />
        </Routes>
      <FormPage />
    </div>
  );
}

export default App;
